import React from 'react';
import '../App.css';
import RecommendedCourse from './RecommendedCourse';

class CourseRecommendor extends React.Component{
  constructor(props){
    super(props);

  }
    getCourses() {
        let courses = [];
        for(const course of Object.entries(this.props.courses)) {
          for(const prev of Object.entries(this.props.previousCourses))
            courses.push(
                <RecommendedCourse key={prev[0]} data={prev[1]}> </RecommendedCourse>
            )
        }
        return courses;
      }

      render() {
        return (

          <div class="container-fluid">
            <div class="row">
              <div class="col-lg-6" >{this.getCourses()}</div>
              <div class="col-lg-6" >{this.getCourses()}</div>
            </div>
          </div>

        )
      }
}


export default CourseRecommendor
